import TelaInicial from "./TelaInicial";
import TelaRecall from "./TelaRecall.js";

let tela = 1;

export default function App() {
    return (
        <>
        if ({tela} === 1) {
            <TelaInicial />
        } else {
            <TelaRecall />
        }
        </>
    );
}
